export const Icon: React.FC<IconProps> = ({ name, size = 20, className, color = "currentColor", ...props }) => {
  const path = iconPaths[name as keyof typeof iconPaths]

  if (!path) {
    console.warn(`Icon "${name}" not found`)
    return null
  }

  return (
    <svg
      width={size}
      height={size}
      viewBox="0 0 32 32"
      fill={color}
      className={cn("inline-block", className)}
      {...props}
    >
      <path fillRule="evenodd" clipRule="evenodd" d={path} />
    </svg>
  )
}

